using Epam.WebPages.Common;
using Epam.WebPages.Entities;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Web;
using System.Web.Helpers;

namespace Epam.WebPages.UIweb.Models
{
    public static class UserModel
    {
        static string defaultavatar = "";             
        public static IEnumerable<User> GetAllUsers()
        {
            return DependencyResolver.UsersLogic.GetAllUsers();
        }
        public static void Regisration(string name, DateTime birthDate, WebImage image, string password, string role)
        {
            if (image != null)
            {
                string base64string = Convert.ToBase64String(image.GetBytes());
                DependencyResolver.UsersLogic.AddUser(name, birthDate, base64string, password, role);
            }
            else
            {
                DependencyResolver.UsersLogic.AddUser(name, birthDate, defaultavatar, password, role);
            }
        }
        public static bool VerifyUser(string login, string password)
        {
            return DependencyResolver.UsersLogic.VerifyUser(login, password);
        }
        public static bool DeleteUser(string id)
        {
            return DependencyResolver.UsersLogic.DeleteUser(Guid.Parse(id));
        }
        public static bool AddAward(Guid userid, Award award)
        {
            return DependencyResolver.UsersLogic.AddAward(userid, award);
        }
        public static bool DeleteAward(Guid userid, Guid awardid)
        {
            return DependencyResolver.UsersLogic.DeleteAward(userid, awardid);
        }

        public static void DeleteUsersAward(string awardId)
        {
            DependencyResolver.UsersLogic.DeleteUsersAward(Guid.Parse(awardId));
        }
    }
}